this.formatDate=function (d)
         {
                     var h=d.getHours()+"";
                     var m=d.getMinutes()+"";

                     var s=d.getSeconds()+"";
                    if (h.length<2) h="0"+h;

                    if (m.length<2) m="0"+m;

                    if (s.length<2) s="0"+s;
                    return h+":"+m+":"+s;
         }

this.setDatasetLabels=function(data){
    var o=this.data.labels=data;

}

this.datarefresh=function(data){


    if (this.minis!==undefined)
    {
        var minis=this.myscada.getTagValue(this.minis);

        if (minis!=null && minis!=this.minisValue)
        {
            this.minisValue=minis;

            this.objekt.config.options.scales.yAxes[0].ticks.min=parseFloat(minis);

        }
    }

        if (this.maxis!==undefined)
    {
        var maxis=this.myscada.getTagValue(this.maxis);

        if (maxis!=null && maxis!=this.maxisValue)
        {
            this.maxisValue=maxis;

            this.objekt.config.options.scales.yAxes[0].ticks.max=parseFloat(maxis);

        }
    }

   if (this.prefill=="1" && this.objekt.data.datasets[0].data.length===0)
    {

        for (var k=0;k<this.groupCount;k++)
        {
            //var d=[];
            for (var i=0;i<data.length;i++)
            {
                if (this.dataToDataset[i]===k)
                {
                    if (data[i].length>0)
                            {
                            var dd=data[i][0];
                        }
                        else
                        {
                             var dd=0;
                        }

                    var refresh=1000;
                    try{
                        refresh=this.myscada.__model.attributes.config.data.refresh;
                    }catch (e){
                        refresh=1000;
                    }

                    var limit=parseFloat(this.limitItems);
                    if (parseFloat(this.limitTime)>0) 
                    {    
                        var pomLim=parseFloat(this.limitTime);
                        pomLim=pomLim*1000/refresh;
                        if (pomLim>limit) limit=pomLim;
                    }

                    var dddate=new Date();
                    var dddateTime=dddate.getTime();
                    for (var t=limit;t>0;t--)
                    {
                            var dddate2=dddateTime-t*refresh;
                            var o={};
                            o.x=new Date(dddate2);
                            o.y=dd;
                            o.t=o.x.valueOf();
                            this.objekt.data.datasets[k].data.push(o);
                            if (k==0) 
                            {
                                this.objekt.data.labels.push(this.formatDate(o.x));
                            }
                    }


                }
            }
        }


    }

    for (var k=0;k<this.groupCount;k++)
    {
        //var d=[];
        for (var i=0;i<data.length;i++)
        {
            if (this.dataToDataset[i]===k)
            {
                if (data[i].length>0)
                {
                var dd=data[i][0];
                var o={};
                o.x=new Date();
                o.y=dd;
                o.t=o.x.valueOf();
                this.objekt.data.datasets[k].data.push(o);
                if (this.limitItems>0 && this.objekt.data.datasets[k].data.length>this.limitItems)
                {
                    this.objekt.data.datasets[k].data.shift();
                    if (k==0) this.objekt.data.labels.shift();
                }

                if (k==0) 
                    {
                        this.objekt.data.labels.push(this.formatDate(o.x));
                    }
                }
                else
                {

                    var o={};
                    o.x=new Date();
                    o.y=0;
                    o.t=o.x.valueOf();
                    this.objekt.data.datasets[k].data.push(o);
                    if (this.limitItems>0 && this.objekt.data.datasets[k].data.length>this.limitItems)
                        {
                            this.objekt.data.datasets[k].data.shift();
                            if (k==0) this.objekt.data.labels.shift();
                        }

                 if (k==0)   this.objekt.data.labels.push(this.formatDate(o.x));

                }
            }
        }

    }


    //kontrola zaznamu dle casu
     if (this.limitTime>0 )
     {

         var date1=new Date();
         date1=date1.getTime();
         var pom=date1-this.limitTime*1000;
         for (var k=0;k<this.groupCount;k++)
            {
                 while (this.objekt.data.datasets[k].data.length>0 && this.objekt.data.datasets[k].data[0].x.getTime()<pom)
                 {
                    this.objekt.data.datasets[k].data.shift();
                     if (k==0 && this.objekt.data.labels.length>0) this.objekt.data.labels.shift();
                 }
             }
     }


    this.objekt.update();
 };


